import list from '@/mixins/list'
import { routerNames } from '@/utils/consts'
import SelectAgentTree from '@/components/SelectAgentTree'
export default {
	name: routerNames.systemUrl,
	components: { SelectAgentTree },
	mixins: [list],
	data() {
		return {
			loading: false,
			form: {
				agentId: ''
			},
			list: []
		}
	},
	computed: {},
	methods: {
		handleReset() {
			this.hadSearch = false
			this.form = {
				agentId: ''
			}
			this.initList()
		},
		handleSearch() {
			this.hadSearch = true
			this.pageIndex = 1
			this.loadData()
		},
		loadData() {
			this.loading = true
			const initData = {
				pageSize: this.pageSize,
				pageIndex: this.pageIndex,
				agentId: this.form.agentId
			}
			this.$api
				.agentLogoLogList(initData)
				.then((_) => {
					this.loading = false
					const data = _.data
					this.list = data.record
					this.total = data.totalRecord
				})
				.catch(() => {
					this.loading = false
				})
		},
		handleCurrentChange(val) {
			this.loadData()
		}
	}
}
